import * as React from "react";

import Typography from "@mui/material/Typography";

export default function Title() {
  return (
    <div>
      {/* There is already an h1 in the page, let's not duplicate it. */}
      <Typography variant="h1" component="h2">
        h1. Heading
      </Typography>
      ;
    </div>
  );
}
